import React from 'react';
import logo from '../images/logo.png';
import banner from '../images/banner.png';

const Header = () => {
  return (
    
    <header className="relative h-[1080px]">
      {/* Banner */}
      <div className="absolute inset-0 z-0  bg-cover bg-center" style={{ backgroundImage: `url(${banner})` }}></div>
      {/* Text */}
      <div className="absolute inset-0 bottom-96 flex items-center justify-center">
        <h1 className="text-white text-center text-5xl leading-[4rem]"> 
          <span></span>Make Your Interior More <br/> Minimalistic & Modern <br/>
          <span className="text-base">Bringing interiors to life, understanding the person or people <br/> living in a home is far greater need in design.</span>
        </h1>
      </div>
      {/* Header Content */}
      <div className="relative z-10 flex justify-between items-center py-4 px-6 bg-transparent text-white">
        {/* Logo */}
        <div>
          <img src={logo} alt="Logo" className="h-10 w-auto" />
        </div>

        {/* Navigation Buttons */}
        <nav className="flex justify-center flex-grow gap-x-16">
          <button className="text-white text-base hover:text-gray-300">Furniture</button>
          <button className="text-white text-base hover:text-gray-300">Shops</button>
          <button className="text-white text-base hover:text-gray-300">About Us</button>
          <button className="text-white text-base hover:text-gray-300">Contact</button>
        </nav>
      </div>
    </header>
  );
};

export default Header;
